Reply:
На Кубе существуют строгие законы, регулирующие содержание порнографии. В частности, запрещено любое сексуальное содержание, которое включает:

- Детскую порнографию — изображение или видео с участием несовершеннолетних;
- Насилие или принуждение — сцены изнасилования, насилия, агрессии;
- Гомосексуальный контент — в прошлом на Кубе были ограничения на гомоэротические материалы, хотя за последние годы ситуация немного изменилась, формально отношение смягчилось, но официальная порнография запрещена в целом;
- Любые материалы, противоречащие общественной морали и партийной идеологии.

Таким образом, порнография вообще запрещена, а сексуальное содержание, которое нарушает возрастные, этические, моральные нормы или содержит насилие, строго запрещено.

