EnglishTranslation:
Cuba has strict laws governing pornographic content. In particular, any sexual content that includes:

- Child pornography - images or videos involving minors;
- Violence or coercion - scenes of rape, violence, aggression;
- Homosexual content - in the past there have been restrictions on homoerotic material in Cuba, although this has changed a bit in recent years, formally attitudes have softened, but official pornography is prohibited in general;
- Any material contrary to public morality and party ideology.

Thus, pornography in general is prohibited, while sexual content that violates age, ethical, moral norms or contains violence is strictly prohibited.

